import React, { Component } from 'react'
import Sidebar from '../Sidebar/Sidebar'
import { Switch, Route } from 'react-router-dom';
import About from '../About/About';

export default class extends Component {
    render() {
        return (
            <React.Fragment>
                <Sidebar />
                <div class="main">

                    <Switch>
                        <Route path="/" component ={A} />
                      
                    </Switch>
                   <About></About>
                </div>

            </React.Fragment>
        )
    }
}
